graphql.query:
mutation LoginFormMutation(
  $email: String!
  $passwordHash: String!
) {
  login(email: $email, passwordHash: $passwordHash)
}

query ChirpReportQuery(
  $input: ChirpQualifyInput!
  $consumerId: ID
) {
  serviceStatuses {
    name
    version
  }
  functionalityEnabled(consumerId: $consumerId, functionalities: [Lms, LiveScore]) {
    id
    name
    enabled
  }
  isIntegrationEnabled(name: "Chirp", consumerId: $consumerId)
  qualify(chirp: $input) {
    id
    accountLabel
    ...ReportAlerts_data
    ...LiveScoreToolbar_data
    ...Account_data
    ...AccountSmall_data
    ...Exposure_data
    ...ExposureRiskFactors_data
    ...Income_data
    ...IncomeSmall_data
    ...Loans_data
    ...LoansSmall_data
    ...RedFlags_data
    ...RedFlagsSmall_data
    ...Transactions_data
    ...NotesButton_data
    ...AddIncome_data
    ...ReportAnalytics_data
    ...SummaryNotesDialog_data
  }
}

fragment AccountSmall_data on BankReport {
  id
  routingNumber
  routingNumberEntered
  routingNumberFound
  accountNumber
  accountNumberEntered
  accountNumberFound
}

